import{_ as s,a as t}from"./chunks/ts_settings_srp_quality_asset.hqyZ_FNb.js";import{_ as o,o as a,c as i,ag as r}from"./chunks/framework.DPLcbSfg.js";const b=JSON.parse('{"title":"Troubleshooting","description":"","frontmatter":{},"headers":[],"relativePath":"troubleshooting/troubleshooting.md","filePath":"troubleshooting/troubleshooting.md"}'),n={name:"troubleshooting/troubleshooting.md"};function l(u,e,c,d,h,g){return a(),i("div",null,[...e[0]||(e[0]=[r('<h1 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h1><p>Common issues and solutions for ProStream.</p><h2 id="setup-issues" tabindex="-1">Setup Issues <a class="header-anchor" href="#setup-issues" aria-label="Permalink to &quot;Setup Issues&quot;">​</a></h2><h3 id="scene-must-be-saved-before-setup" tabindex="-1">Scene must be saved before setup <a class="header-anchor" href="#scene-must-be-saved-before-setup" aria-label="Permalink to &quot;Scene must be saved before setup&quot;">​</a></h3><p><strong>Issue:</strong> Setup button shows &quot;Scene must be saved&quot; message</p><p><strong>Solution:</strong> ProStream requires scenes to be saved to disk before setup. Save your scene via <strong>File | Save Scene</strong> first.</p><h3 id="sceneconnector-not-created-after-setup" tabindex="-1">SceneConnector not created after setup <a class="header-anchor" href="#sceneconnector-not-created-after-setup" aria-label="Permalink to &quot;SceneConnector not created after setup&quot;">​</a></h3><p><strong>Issue:</strong> SceneConnector GameObject doesn&#39;t appear after clicking Setup</p><p><strong>Check:</strong></p><ul><li>The scene automatically reloaded after clicking Setup</li><li>Check the Console for any errors during setup</li><li>Verify the scene has the &quot;StreamingScene&quot; label in Project window</li><li>Look for <code>SceneName/SceneData/</code> folder in your Assets</li></ul><h3 id="lost-references-missing-scripts" tabindex="-1">Lost References / Missing Scripts <a class="header-anchor" href="#lost-references-missing-scripts" aria-label="Permalink to &quot;Lost References / Missing Scripts&quot;">​</a></h3><p><strong>Issue:</strong> Components show as &quot;Missing Script&quot; after installation/update</p><p><strong>Cause:</strong> Installing or updating ProStream while a scene with ProStream components is open</p><p><strong>Solution:</strong></p><ol><li>Close all scenes before installing/updating</li><li>Install/update ProStream</li><li>Reopen scenes after installation completes</li><li>If references are lost, you may need to re-run scene setup</li></ol><h2 id="search-filter-issues" tabindex="-1">Search Filter Issues <a class="header-anchor" href="#search-filter-issues" aria-label="Permalink to &quot;Search Filter Issues&quot;">​</a></h2><h3 id="no-searchfilter-objects-found" tabindex="-1">No SearchFilter Objects found <a class="header-anchor" href="#no-searchfilter-objects-found" aria-label="Permalink to &quot;No SearchFilter Objects found&quot;">​</a></h3><p><strong>Issue:</strong> Error message during Calculate Positions</p><p><strong>Solution:</strong> You need to add Scene Search Filters! Click &quot;Add Search Filters&quot; in ProStream Editor and select root GameObjects that contain your prefabs.</p><h3 id="no-matchtrackers-added" tabindex="-1">No MatchTrackers added <a class="header-anchor" href="#no-matchtrackers-added" aria-label="Permalink to &quot;No MatchTrackers added&quot;">​</a></h3><p><strong>Issue:</strong> Objects under search filters aren&#39;t being tracked</p><p><strong>Check:</strong></p><ul><li>Your selected GameObjects contain prefab instances (not regular GameObjects)</li><li>Prefabs are children of the search filter GameObject</li><li>Check Console for processing messages</li><li>Verify objects are actually prefabs (blue icon in hierarchy)</li></ul><h2 id="rule-matching-issues" tabindex="-1">Rule Matching Issues <a class="header-anchor" href="#rule-matching-issues" aria-label="Permalink to &quot;Rule Matching Issues&quot;">​</a></h2><h3 id="no-rules-have-been-added" tabindex="-1">No rules have been added <a class="header-anchor" href="#no-rules-have-been-added" aria-label="Permalink to &quot;No rules have been added&quot;">​</a></h3><p><strong>Issue:</strong> Error during Calculate Positions</p><p><strong>Solution:</strong> Enable at least one rule in the Rule Editor. Open <strong>Scene Match Rules &gt; Rule Editor</strong> and enable example rules.</p><h3 id="no-objects-matched" tabindex="-1">No objects matched <a class="header-anchor" href="#no-objects-matched" aria-label="Permalink to &quot;No objects matched&quot;">​</a></h3><p><strong>Issue:</strong> Calculate Positions completes but no objects are matched</p><p><strong>Check:</strong></p><ul><li>Search query in SceneSearchFilter is correct</li><li>Rules are enabled (checkmark in Rule Editor)</li><li>Rules actually match your objects (test queries in Unity Search: <code>Ctrl+K</code>)</li><li>Objects are under search filters</li><li>Objects are prefabs</li></ul><h3 id="objects-matched-by-wrong-rule" tabindex="-1">Objects matched by wrong rule <a class="header-anchor" href="#objects-matched-by-wrong-rule" aria-label="Permalink to &quot;Objects matched by wrong rule&quot;">​</a></h3><p><strong>Issue:</strong> Objects assigned to incorrect layer/section</p><p><strong>Solution:</strong></p><ul><li>Check rule priority order (first match wins)</li><li>Reorder rules in Rule Editor</li><li>Make earlier rules more specific</li><li>Test queries individually</li></ul><h2 id="position-calculation-issues" tabindex="-1">Position Calculation Issues <a class="header-anchor" href="#position-calculation-issues" aria-label="Permalink to &quot;Position Calculation Issues&quot;">​</a></h2><h3 id="calculate-positions-fails-immediately" tabindex="-1">Calculate Positions fails immediately <a class="header-anchor" href="#calculate-positions-fails-immediately" aria-label="Permalink to &quot;Calculate Positions fails immediately&quot;">​</a></h3><p><strong>Issue:</strong> Process fails with errors</p><p><strong>Check:</strong></p><ul><li>At least one search filter is configured</li><li>At least one rule is enabled</li><li>Scene is saved</li><li>No compilation errors</li><li>Check Console for specific error messages</li></ul><h3 id="process-hangs-or-takes-very-long" tabindex="-1">Process hangs or takes very long <a class="header-anchor" href="#process-hangs-or-takes-very-long" aria-label="Permalink to &quot;Process hangs or takes very long&quot;">​</a></h3><p><strong>Issue:</strong> Calculate Positions doesn&#39;t complete</p><p><strong>Possible causes:</strong></p><ul><li>Very large scene (thousands of objects)</li><li>Complex search queries</li><li>Validation enabled with many objects</li></ul><p><strong>Solutions:</strong></p><ul><li>Disable validation temporarily</li><li>Simplify search queries</li><li>Split scene into smaller sections</li><li>Check Console for progress messages</li></ul><h2 id="subscene-creation-issues" tabindex="-1">SubScene Creation Issues <a class="header-anchor" href="#subscene-creation-issues" aria-label="Permalink to &quot;SubScene Creation Issues&quot;">​</a></h2><h3 id="subscenes-empty-in-play-mode" tabindex="-1">SubScenes empty in Play Mode <a class="header-anchor" href="#subscenes-empty-in-play-mode" aria-label="Permalink to &quot;SubScenes empty in Play Mode&quot;">​</a></h3><p><strong>Issue:</strong> SubScenes load but contain no objects</p><p><strong>Check:</strong></p><ul><li>Position Calculation completed successfully</li><li>SubScene creation completed successfully</li><li>Open SubScene <code>.unity</code> files manually to verify objects are inside</li><li>Check Console for errors during creation</li><li>Verify objects were matched during Position Calculation</li></ul><h3 id="subscene-files-not-created" tabindex="-1">SubScene files not created <a class="header-anchor" href="#subscene-files-not-created" aria-label="Permalink to &quot;SubScene files not created&quot;">​</a></h3><p><strong>Issue:</strong> No <code>.unity</code> files in SubScene_Assets folder</p><p><strong>Check:</strong></p><ul><li>Position Calculation was run first</li><li>Write permissions in Assets folder</li><li>Sufficient disk space</li><li>Console for specific errors</li></ul><h3 id="scene-reload-fails" tabindex="-1">Scene reload fails <a class="header-anchor" href="#scene-reload-fails" aria-label="Permalink to &quot;Scene reload fails&quot;">​</a></h3><p><strong>Issue:</strong> Unity hangs or crashes during scene reload</p><p><strong>Solutions:</strong></p><ul><li>Save scene before running process</li><li>Close other scenes first</li><li>Check for compilation errors</li><li>Try restarting Unity</li><li>Check Unity version compatibility</li></ul><h2 id="runtime-streaming-issues" tabindex="-1">Runtime/Streaming Issues <a class="header-anchor" href="#runtime-streaming-issues" aria-label="Permalink to &quot;Runtime/Streaming Issues&quot;">​</a></h2><h3 id="streaming-not-working" tabindex="-1">Streaming not working <a class="header-anchor" href="#streaming-not-working" aria-label="Permalink to &quot;Streaming not working&quot;">​</a></h3><p><strong>Issue:</strong> Objects don&#39;t load/unload during Play Mode</p><p><strong>Check:</strong></p><ul><li>You&#39;re in Play Mode</li><li>Camera/player is moving around</li><li>Streaming distances are appropriate for your scene size</li><li>StreamingManager exists in scene (auto-created after SubScene creation)</li><li>Loading Trigger is assigned in StreamingManager</li><li>StreamingManager is enabled</li></ul><h3 id="sections-not-loading" tabindex="-1">Sections not loading <a class="header-anchor" href="#sections-not-loading" aria-label="Permalink to &quot;Sections not loading&quot;">​</a></h3><p><strong>Issue:</strong> SubScenes don&#39;t load when player is nearby</p><p><strong>Check:</strong></p><ul><li>Loading Trigger is assigned in StreamingManager</li><li>Distances are configured correctly in Layer Editor</li><li>StreamingManager component is enabled</li><li>Check Console for errors</li><li>Verify SubScene files exist</li></ul><h3 id="sections-loading-too-late-early" tabindex="-1">Sections loading too late/early <a class="header-anchor" href="#sections-loading-too-late-early" aria-label="Permalink to &quot;Sections loading too late/early&quot;">​</a></h3><p><strong>Issue:</strong> Objects pop in too close or load too far away</p><p><strong>Solution:</strong></p><ul><li>Adjust layer distances in Layer Editor</li><li>Increase distances for earlier loading</li><li>Decrease distances for later loading</li><li>Adjust hysteresis buffer</li></ul><h3 id="memory-usage-too-high" tabindex="-1">Memory usage too high <a class="header-anchor" href="#memory-usage-too-high" aria-label="Permalink to &quot;Memory usage too high&quot;">​</a></h3><p><strong>Issue:</strong> Game uses too much memory</p><p><strong>Solutions:</strong></p><ul><li>Reduce layer load distances</li><li>Split large layers into smaller ones</li><li>Use more aggressive culling</li><li>Check for memory leaks in Profiler</li></ul><h2 id="build-issues" tabindex="-1">Build Issues <a class="header-anchor" href="#build-issues" aria-label="Permalink to &quot;Build Issues&quot;">​</a></h2><h3 id="no-objects-in-game-build" tabindex="-1">No Objects In Game (Build) <a class="header-anchor" href="#no-objects-in-game-build" aria-label="Permalink to &quot;No Objects In Game (Build)&quot;">​</a></h3><p><strong>Issue:</strong> After building, no objects appear in the game</p><p><strong>Cause:</strong> SRP asset not assigned in build settings</p><p><strong>Solution:</strong> Ensure an SRP asset is assigned in the following places:</p><table tabindex="0"><thead><tr><th>Location</th><th>Setting</th></tr></thead><tbody><tr><td><strong>Project Settings \\ Graphics</strong></td><td>Scriptable Render Pipeline Settings</td></tr><tr><td><strong>Project Settings \\ Graphics</strong></td><td>URP Global Settings</td></tr><tr><td><strong>Project Settings \\ Quality</strong></td><td>Rendering (per quality level)</td></tr></tbody></table><p><img src="'+s+'" alt="SRP Global Settings"><img src="'+t+'" alt="SRP Quality Settings"></p><h3 id="objectdisposedexception-errors" tabindex="-1">ObjectDisposedException errors <a class="header-anchor" href="#objectdisposedexception-errors" aria-label="Permalink to &quot;ObjectDisposedException errors&quot;">​</a></h3><p><strong>Issue:</strong> Constant &quot;UNKNOWN_OBJECT_TYPE has been deallocated&quot; errors</p><p><strong>Cause:</strong> Installing/updating Entities package while scene with SubScenes is open</p><p><strong>Solution:</strong></p><ol><li>Close all scenes</li><li>Update packages</li><li>Restart Unity</li><li>Reopen scenes</li></ol><h2 id="validation-issues" tabindex="-1">Validation Issues <a class="header-anchor" href="#validation-issues" aria-label="Permalink to &quot;Validation Issues&quot;">​</a></h2><h3 id="validation-finds-many-errors" tabindex="-1">Validation finds many errors <a class="header-anchor" href="#validation-finds-many-errors" aria-label="Permalink to &quot;Validation finds many errors&quot;">​</a></h3><p><strong>Issue:</strong> Validation reports numerous compatibility issues</p><p><strong>Approach:</strong></p><ol><li>Address critical errors first</li><li>Fix warnings that apply to your setup</li><li>Ignore warnings that don&#39;t affect your use case</li><li>See <a href="/editor-guide/tools/validation-diagnostics.html">Validation &amp; Diagnostics</a> for details</li></ol><h3 id="validation-takes-too-long" tabindex="-1">Validation takes too long <a class="header-anchor" href="#validation-takes-too-long" aria-label="Permalink to &quot;Validation takes too long&quot;">​</a></h3><p><strong>Issue:</strong> Calculate Positions is very slow with validation enabled</p><p><strong>Solution:</strong></p><ul><li>Disable &quot;Check for advanced issues&quot;</li><li>Only enable validation when needed</li><li>Run validation separately using Diagnostics Hub</li></ul><h2 id="performance-issues" tabindex="-1">Performance Issues <a class="header-anchor" href="#performance-issues" aria-label="Permalink to &quot;Performance Issues&quot;">​</a></h2><h3 id="editor-performance-slow" tabindex="-1">Editor performance slow <a class="header-anchor" href="#editor-performance-slow" aria-label="Permalink to &quot;Editor performance slow&quot;">​</a></h3><p><strong>Issue:</strong> Unity Editor is sluggish with ProStream</p><p><strong>Possible causes:</strong></p><ul><li>Very large scene</li><li>Many search filters</li><li>Complex rules</li></ul><p><strong>Solutions:</strong></p><ul><li>Limit search filter scope</li><li>Simplify rules</li><li>Close unnecessary Editor windows</li><li>Increase Unity&#39;s memory allocation</li></ul><h3 id="runtime-performance-issues" tabindex="-1">Runtime performance issues <a class="header-anchor" href="#runtime-performance-issues" aria-label="Permalink to &quot;Runtime performance issues&quot;">​</a></h3><p><strong>Issue:</strong> Game runs slowly with streaming</p><p><strong>Check:</strong></p><ul><li>Too many sections loading simultaneously</li><li>Distances too large (loading too much)</li><li>Complex modifications running</li><li>Profile with Unity Profiler to identify bottlenecks</li></ul><h2 id="common-error-messages" tabindex="-1">Common Error Messages <a class="header-anchor" href="#common-error-messages" aria-label="Permalink to &quot;Common Error Messages&quot;">​</a></h2><h3 id="scene-must-have-at-least-one-search-filter" tabindex="-1">&quot;Scene must have at least one search filter&quot; <a class="header-anchor" href="#scene-must-have-at-least-one-search-filter" aria-label="Permalink to &quot;&quot;Scene must have at least one search filter&quot;&quot;">​</a></h3><p><strong>Solution:</strong> Add search filters via ProStream Editor</p><h3 id="no-enabled-rules-found" tabindex="-1">&quot;No enabled rules found&quot; <a class="header-anchor" href="#no-enabled-rules-found" aria-label="Permalink to &quot;&quot;No enabled rules found&quot;&quot;">​</a></h3><p><strong>Solution:</strong> Enable at least one rule in Rule Editor</p><h3 id="position-calculation-not-complete" tabindex="-1">&quot;Position calculation not complete&quot; <a class="header-anchor" href="#position-calculation-not-complete" aria-label="Permalink to &quot;&quot;Position calculation not complete&quot;&quot;">​</a></h3><p><strong>Solution:</strong> Run Calculate Positions before Create SubScenes</p><h3 id="failed-to-create-subscene-asset" tabindex="-1">&quot;Failed to create SubScene asset&quot; <a class="header-anchor" href="#failed-to-create-subscene-asset" aria-label="Permalink to &quot;&quot;Failed to create SubScene asset&quot;&quot;">​</a></h3><p><strong>Solution:</strong> Check write permissions and disk space</p><h3 id="loading-trigger-not-assigned" tabindex="-1">&quot;Loading trigger not assigned&quot; <a class="header-anchor" href="#loading-trigger-not-assigned" aria-label="Permalink to &quot;&quot;Loading trigger not assigned&quot;&quot;">​</a></h3><p><strong>Solution:</strong> Assign player/camera to StreamingManager&#39;s Loading Trigger field</p><h2 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-label="Permalink to &quot;Getting Help&quot;">​</a></h2><p>If you&#39;re still experiencing issues:</p><ol><li><strong>Check Console</strong> - Most errors have detailed messages</li><li><strong>Enable Debug Logging</strong> - Turn on verbose logging in settings</li><li><strong>Review Documentation</strong> - Check relevant sections</li><li><strong>Verify Prerequisites</strong> - Ensure all requirements are met</li><li><strong>Test with Simple Scene</strong> - Reproduce issue in minimal setup</li></ol><h2 id="see-also" tabindex="-1">See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;See Also&quot;">​</a></h2><ul><li><a href="/getting-started/prerequisites.html">Prerequisites</a> - Setup requirements</li><li><a href="/getting-started/standard-workflow.html">Standard Workflow</a> - Complete guide</li><li><a href="/editor-guide/tools/validation-diagnostics.html">Validation &amp; Diagnostics</a> - Validation tools</li><li><a href="/runtime-systems/runtime-streaming.html">Runtime Streaming</a> - Runtime behavior</li></ul>',124)])])}const f=o(n,[["render",l]]);export{b as __pageData,f as default};
